    const [time, onChangeTime] = useState('10:00');

    const selectTimeFrom = (e) => {
        onChangeTime(time => e.target.value); 
    }

    console.log(time); 

    return (
    <form className={styles.container} noValidate>
        <TextField
            className={styles.textField}
            id="time"
            label="From"
            type="time"
            defaultValue="07:30"
            value={time}
            onChange={e => selectTime(e)}
